import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Home from "./Home";
import Gozareshat from "./Gozareshat";
import Setting from "./Setting";

class Menu extends Component {
  state = {};
  render() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">نمایش لحظه ای</Link>
              </li>
              <li>
                <Link to="/Gozareshat">گزارشات</Link>
              </li>
              <li>
                <Link to="/setting">تنظیمات</Link>
              </li>
            </ul>
          </nav>

          <Switch>
            <Route path="/">
              <Home />
            </Route>
            <Route path="/Gozareshat">
              <Gozareshat />
            </Route>
            <Route path="/Setting">
              <Setting />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default Menu;
